// src/pages/InvitesAdmin.js
import React, { useEffect, useState } from 'react';
import Section from '../components/UI/Section';

const emptyForm = { code: '', defaultName: '', monthsPregnant: '', gender: '', assignedToEmail: '' };

const InvitesAdmin = () => {
  const [invites, setInvites] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [form, setForm] = useState(emptyForm);
  const [saving, setSaving] = useState(false);

  const load = async () => {
    try {
      setLoading(true);
      const res = await fetch('/api/invites', { credentials: 'include' });
      const data = await res.json();
      setInvites(Array.isArray(data) ? data : []);
    } catch (_) {
      setError('Failed to load invites');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => { load(); }, []);

  const createInvite = async (e) => {
    e.preventDefault();
    setSaving(true);
    setError('');
    try {
      const payload = {
        code: form.code || undefined,
        defaultName: form.defaultName || '',
        monthsPregnant: form.monthsPregnant !== '' ? Number(form.monthsPregnant) : null,
        gender: form.gender || '',
        assignedToEmail: form.assignedToEmail || '',
      };
      const res = await fetch('/api/invites', {
        method: 'POST', headers: { 'Content-Type': 'application/json' }, credentials: 'include', body: JSON.stringify(payload)
      });
      if (!res.ok) throw new Error('Create failed');
      await load();
      setForm(emptyForm);
    } catch (e) {
      setError(e.message || 'Failed to create invite');
    } finally {
      setSaving(false);
    }
  };

  const updateInvite = async (id, update) => {
    try {
      const res = await fetch(`/api/invites/${id}`, {
        method: 'PUT', headers: { 'Content-Type': 'application/json' }, credentials: 'include', body: JSON.stringify(update)
      });
      if (!res.ok) throw new Error('Update failed');
      await load();
    } catch (e) {
      setError(e.message || 'Failed to update invite');
    }
  };

  const deleteInvite = async (id) => {
    if (!window.confirm('Delete this invite?')) return;
    try {
      const res = await fetch(`/api/invites/${id}`, { method: 'DELETE', credentials: 'include' });
      if (!res.ok && res.status !== 204) throw new Error('Delete failed');
      await load();
    } catch (e) {
      setError(e.message || 'Failed to delete invite');
    }
  };

  const toggleUsed = async (it) => {
    const update = it.usedAt ? { usedAt: null, usedByUserId: '' } : { usedAt: Date.now() };
    await updateInvite(it.id || it.code, update);
  };

  return (
    <div className="min-h-screen bg-white">
      <Section title="Manage Invites" center tightTop compact>
        {error && <p className="text-red-600 mb-4">{error}</p>}
        <form onSubmit={createInvite} className="cc-card mb-8 grid gap-4 text-left">
          <h3 className="font-serif text-xl text-black">Create Invite</h3>
          <div className="grid md:grid-cols-2 gap-4">
            <input
              className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              placeholder="Code (optional)"
              value={form.code}
              onChange={(e)=>setForm({...form, code:e.target.value})}
            />
            <input
              className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              placeholder="Default name (optional)"
              value={form.defaultName}
              onChange={(e)=>setForm({...form, defaultName:e.target.value})}
            />
            <input
              type="number"
              min="0"
              max="9"
              className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              placeholder="Months pregnant (0-9)"
              value={form.monthsPregnant}
              onChange={(e)=>setForm({...form, monthsPregnant:e.target.value})}
            />
            <select
              className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              value={form.gender}
              onChange={(e)=>setForm({...form, gender:e.target.value})}
            >
              <option value="">Gender (optional)</option>
              <option value="girl">Girl</option>
              <option value="boy">Boy</option>
            </select>
            <input
              className="md:col-span-2 w-full rounded-lg border-2 border-gold/40 focus:border-gold px-4 py-3 bg-white"
              placeholder="Assign to email (optional)"
              value={form.assignedToEmail}
              onChange={(e)=>setForm({...form, assignedToEmail:e.target.value})}
            />
          </div>
          <div>
            <button disabled={saving} type="submit" className="btn btn-primary">{saving ? 'Creating…' : 'Create Invite'}</button>
          </div>
        </form>

        {loading ? (
          <p>Loading…</p>
        ) : (
          <div className="grid gap-6 md:grid-cols-2">
            {invites.map((it) => (
              <div key={it.id || it.code} className="cc-card text-left">
                <div className="grid gap-2">
                  <div className="flex items-center justify-between">
                    <h4 className="font-serif text-lg text-black">Code: {it.code}</h4>
                    <span className="text-xs text-black/60">{it.usedAt ? 'Used' : 'Unused'}</span>
                  </div>
                  <label className="text-black text-sm">Default Name</label>
                  <input
                    className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-3 py-2 bg-white"
                    value={it.defaultName || ''}
                    onChange={(e)=>setInvites((prev)=>prev.map((x)=> x===it ? {...x, defaultName:e.target.value} : x))}
                  />
                  <label className="text-black text-sm">Months Pregnant</label>
                  <input
                    type="number" min="0" max="9"
                    className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-3 py-2 bg-white"
                    value={it.monthsPregnant ?? ''}
                    onChange={(e)=>setInvites((prev)=>prev.map((x)=> x===it ? {...x, monthsPregnant: e.target.value === '' ? null : Number(e.target.value)} : x))}
                  />
                  <label className="text-black text-sm">Gender</label>
                  <select
                    className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-3 py-2 bg-white"
                    value={it.gender || ''}
                    onChange={(e)=>setInvites((prev)=>prev.map((x)=> x===it ? {...x, gender:e.target.value} : x))}
                  >
                    <option value="">Unspecified</option>
                    <option value="girl">Girl</option>
                    <option value="boy">Boy</option>
                  </select>
                  <label className="text-black text-sm">Assigned Email</label>
                  <input
                    className="w-full rounded-lg border-2 border-gold/40 focus:border-gold px-3 py-2 bg-white"
                    value={it.assignedToEmail || ''}
                    onChange={(e)=>setInvites((prev)=>prev.map((x)=> x===it ? {...x, assignedToEmail:e.target.value} : x))}
                  />
                </div>
                <div className="mt-4 flex flex-wrap gap-3">
                  <button className="btn btn-primary" onClick={()=>updateInvite(it.id || it.code, {
                    defaultName: it.defaultName || '',
                    monthsPregnant: it.monthsPregnant ?? null,
                    gender: it.gender || '',
                    assignedToEmail: it.assignedToEmail || ''
                  })}>Save</button>
                  <button className="px-3 py-2 rounded border-2 border-gold/40 bg-white text-black" onClick={()=>toggleUsed(it)}>
                    {it.usedAt ? 'Mark Unused' : 'Mark Used'}
                  </button>
                  <button className="px-3 py-2 rounded border-2 border-gold/40 bg-white text-black" onClick={()=>deleteInvite(it.id || it.code)}>Delete</button>
                </div>
              </div>
            ))}
          </div>
        )}
      </Section>
    </div>
  );
};

export default InvitesAdmin;
